import React from "react";
import HeaderLogedin from "../components/headerLogedin";
import { Box, Divider, Paper, Stack, Typography } from "@mui/material";
import Grid from "@mui/material/Grid";

export default function Profile() {
  const ContainerStyle = {
    marginTop: "20px",
    marginBottom: "50px",
    padding: "20px",
    backgroundColor: "#F0F0F0",
  };
  const ColumnStyle = {
    backgroundColor: "white",
    borderRadius: "3px",
    marginBottom: "5px",
    padding: "30px",
    justifyContent: "flex-end",
  };
  const iconStyle = {
    width: "20px",
    height: "20px",
    marginLeft: "20px",
  };
  const PositionStyle = {
    marginBottom: "20px",
    justifyContent: "flex-end",
    alignItems: "center",
  };

  return (
    <>
      <HeaderLogedin />
      <Divider sx={{ marginTop: "80px" }} />
      <Paper sx={ContainerStyle} elevation={5}>
        <Grid sx={{ height: "600px" }} container spacing={0}>
          <Grid item xs={6} md={9} sx={{ paddingLeft: "5px" }}>
            <Box sx={ColumnStyle}></Box>
          </Grid>
          <Grid item xs={6} md={3}>
            <Stack direction="row" sx={ColumnStyle}>
              <Box>
                <Typography variant="h5">به پلاک ۲۶ خوش آمدید</Typography>
                <Typography sx={{ mt: "10px", textAlign: "left" }} variant="h5">
                  ۰۹۱۲۴۳۵۶۶۸۸
                </Typography>
              </Box>

              <img
                style={{
                  width: "40px",
                  height: "40px",
                  marginLeft: "30px",
                  borderRadius: "100px",
                }}
                src={require("../assets/images/Profile.png")}
              />
            </Stack>
            <Stack sx={ColumnStyle}>
              <Stack direction="row" sx={PositionStyle}>
                <Box>
                  <Typography variant="body1">پیشخوان</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector.png")}
                />
              </Stack>
              <Stack direction="row" sx={PositionStyle}>
                <Box>
                  <Typography variant="body1">لیست نشان‌شده</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector1.png")}
                />
              </Stack>
              <Stack direction="row" sx={PositionStyle}>
                <Box>
                  <Typography variant="body1">خرید اشتراک</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector2.png")}
                />
              </Stack>
              <Stack direction="row" sx={PositionStyle}>
                <Box>
                  <Typography variant="body1"> ثبت فروشگاه</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector3.png")}
                />
              </Stack>
              <Stack direction="row" sx={PositionStyle}>
                <Box>
                  <Typography variant="body1"> درج آگهی </Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector3.png")}
                />
              </Stack>
              <Stack direction="row" sx={PositionStyle}>
                <Box>
                  <Typography variant="body1">پشتیبانی</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector3.png")}
                />
              </Stack>
              <Divider />
              <Stack direction="row" sx={PositionStyle}>
                <Box>
                  <Typography variant="body1">ویرایش حساب کاربری</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector3.png")}
                />
              </Stack>
              <Stack direction="row" sx={PositionStyle}>
                <Box>
                  <Typography variant="body1">خروج از حساب</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector3.png")}
                />
              </Stack>
            </Stack>
          </Grid>
        </Grid>
      </Paper>
    </>
  );
}
